import { InputBase } from '@mui/material';
import './search.css';
import SearchIcon from '@mui/icons-material/Search';

const Search = () => {
    return (
        <>
            <div className="inputContainer">
                <InputBase
                    placeholder="Search for products, brands and more"
                    className="inputdata"
                />
                <div class="searchIcon">
                    <SearchIcon />
                </div>
            </div>
        </>
    );
};

export default Search;
